Job Description:
At the Federal Reserve Bank of San Francisco, we believe in the diversity of our people, ideas, and experiences and are committed to building an inclusive culture that is representative of our District.

Do you have a passion for data? Are you curious about monetary policy and regulation of banking organizations? If so, an exciting opportunity as an Associate Regulatory Data Analyst awaits you!

The Statistics group collects, validates, and provides high-quality data to support our supervisory and monetary policy objectives. As an analyst on the Call & Deposits team, you will draw upon your knowledge of economics, finance, accounting, and data analytics to collaborate with a diverse team whose primary focus is to ensure that data collected are fit for its intended use by the Board of Governors and other divisions within the Bank, including Supervision and Regulation. These data are also used more broadly by other regulatory agencies and the public.

Highlights of Responsibilities:
Collect, validate, and interpret financial reports data to ensure quality, accuracy, and conformity with reporting instructions, accounting principles, and regulations;
Apply understanding of report instructions, policies, regulation, and accounting concepts to review and process reserves, financial, and/or structure data in a timely manner;
Respond clearly and knowledgeably to requests for information and interpretation of reporting instructions when providing direction to financial institutions, data users, and members of management;
Perform hands-on exploratory data analysis using a variety of tools and languages such as Excel, SQL, R, Tableau, and proprietary software to identify inconsistencies, trends, and/or anomalies that provide improved data quality and add-value contextual information to our clients;
Support data collection efforts as back-up to the Report Series coordinator and participant in ad-hoc team projects;
Actively experiment with new processes and influence the adoption of your ideas.
Qualifications:



To be considered for this position, you should be able to demonstrate your proficiency with data analysis and interpretation, familiarity with accounting concepts, communication skills, a growth-mindset, and your innovative approach when taking on new challenges. Additionally, you exhibit strong behavioral attributes, particularly in the areas of collaboration, emotional intelligence, accountability, and critical thinking. Specific qualifications include:
A Bachelor’s degree in Economics, Finance, Banking, Data Science, or related;
1+ years of related experience, including internships, within the banking industry, regulatory/SEC reporting, accounting for a public company, or auditing;
Strong time management skills proven by consistently meeting deadlines and balancing shifting priorities;
Experience collaborating with others to meet goals and deadlines;
Strong communication skills, demonstrated by:
Communicating complex issues succinctly;
Adapting communications to audiences internal and external to the organization;
Crafting and conducting effective presentations;
US citizenship required.
Benefits:


We offer a wonderful benefits package including: Medical, Dental, Vision, Pre-Tax Flexible Spending Accounts for Medical and Day Care, Vacation and Sick Days, 10 Paid Holidays, Paid VTO, Matching 401K up to 6% and much more.


Location:

The Bank is located at 101 Market Street in San Francisco, CA with easy Bay Area commute access via the Embarcadero BART station and ferries at the nearby San Francisco Ferry Building.

The Federal Reserve Bank of San Francisco is an Equal Opportunity Employer. Our people proudly reflect the diversity and ideas of the communities we serve. We will ensure that individuals with disabilities are provided reasonable accommodation to participate in the job application or interview process, to perform essential job functions, and to receive other benefits and privileges of employment.

PMC: Senior Data Analyst

COVID-19 HIRING UPDATE: We have transitioned to a remote work model and are continuing to hire during this time. This role is expected to begin as a remote position. We appreciate this is unprecedented times and will work closely with you, taking into account your individual circumstances.

PMC is seeking a Senior Data Analyst who will turn data into information, information into insight, and insight into business decisions. Based in our West LA headquarters, this role will support the subscription strategy team and work heavily with paywall and engagement tactics to drive revenue growth.

Responsibilities
Interpret data, analyze results using statistical techniques and provide ongoing visualization and reporting;
Develop and implement data collection systems, data analytics and other strategies that optimize statistical efficiency and quality;
Acquire data from primary or secondary data sources and maintain databases/data systems;
Process confidential data and information according to guidelines;
Identify, analyze, and interpret trends or patterns in complex data sets;
Filter and clean data to ensure accurate analysis;
Work with management to prioritize business and information needs;
Training end users on new reports and dashboards;
Locate and define new process improvement opportunities.
Requirements
Work experience as a senior data analyst or in a related field;
Technical expertise regarding data models, data mining and segmentation techniques;
Experience in handling large data sets and relational databases;
Strong knowledge of and experience with reporting packages, SQL databases, programming (python, XML, JavaScript);
Knowledge of statistics and experience using statistical packages for analyzing datasets (Excel, R or SPSS);
Strong analytical skills with the ability to collect, organize, analyze, and disseminate significant amounts of information with attention to detail and accuracy;
Adept at queries, report writing and presenting findings;
Visualization expertise (Looker/Tableau/PowerBI/etc);
Ability to translate business requirements into non-technical, lay terms. High-level written and verbal communication skills. Comfortable presenting analysis.
BS/MS in Mathematics, Economics, Computer Science, Information Management or Statistics a plus.

About PMC:


Penske Media Corporation (PMC) is a leading digital media and information services company whose award-winning content attracts a monthly audience of more than 180 million and empowers more than 1 million global CEOs and business thought-leaders in markets that impact the world. Our dynamic events, data services, and rich content entertain and educate todays fashion, retail, beauty, entertainment and lifestyle sectors. Headquartered in New York and Los Angeles with additional offices in 11 countries worldwide, Penske Media is the way global influencers are informed, connected, and inspired. To learn more about PMC and its iconic brands, visit www.pmc.com.

